import './Section3.css'

function Section3(){

    function handleForm(e){
        e.preventDefault()
        console.log('poo')

        return false;
    }

    return(
        <div id='section3'>
            <img src="Images/bg1.jpg" alt="" />
            <form className='form' action=''onSubmit={'return false'}>
                <h2>Contact Form</h2>
                <div className='first'>   
                    <input placeholder='First Name' type="text" />
                    <input placeholder='Last Name' type="text" />
                </div>
                <input type="text" placeholder='Email' className='email'/>
                <input type="text"placeholder='Phone #' className='phone'/>
                <textarea name="info" className='addInfo' rows="5" placeholder='Additional Info'></textarea>
                <button type="submit" className='sbt-btn' onClick={(e) => handleForm}> Send </button>
            </form>
        </div>
    )
}

export default Section3;
